import React, { useState } from "react";
import Modal from "../UI/Modal";
import Button from "../UI/Button";
import "./TaskBar.css";

export default function TaskBar() {
  const [vehicleEntry, setVehicleEntry] = useState(false);

  const handleVehicleEntry = () => {
    setVehicleEntry((prevState) => !prevState);
  };

  return (
    <>
      {vehicleEntry && <Modal>test</Modal>}
      <div className="task-bar">
        <div>
          <h2>Toll entries/Vehicle entries</h2>
        </div>
        <div>
          <Button onClick={handleVehicleEntry}>Add vehicle entry</Button>
          <Button>Add new toll</Button>
          <Button>View all tolls</Button>
        </div>
      </div>
    </>
  );
}
